import React from 'react';

function AboutMe() {
  <main>
    <section>
      <h2>sou Sérgio Rodrigues</h2>
      <h5>Desenvolvedor Full Stack</h5>
      <p>Tenho 29 anos e sou de Recife, Pernanbuco. Adoro trabalhar em equipe e compartilhar experiencias e conhecimentos.</p>
      <p>Acredito que ter boas relações com pessoas é uma parte fudamental para ser um bom profissional, por isso procuro desenvolver tanto minhas habilidades de comunicação interpessoal, quanto meus conhecimentos técnicos.</p>
      <p>Atualmente estudo desenvolvimento web na trybe, mas não quero parar por aqui. Espero dentro de um futuro próximo ingressar em um curso superior na área de tecnologia.</p>
    </section>
    <img alt="Foto de Sérgio" src="../../pp.jpeg" />
  </main>
};

export default AboutMe;
